'''Neil Richard MacKinnon Gaiman''' ({{IPAc-en|ˈ|ɡ|eɪ|m|ən}};<ref>{{cite web|url=http://www.teachingbooks.net/pronounce.cgi?aid=1433 |title=Author Name Pronunciation Guide – Neil Gaiman |publisher=Teachingbooks.net |archive-url= https://web.archive.org/web/20131022030005/http://www.teachingbooks.net/pronounce.cgi?aid=1433|archive-date= 22 October 2013|url-status= live|access-date=26 July 2011}}</ref> born '''Neil Richard Gaiman'''; 10 November 1960) is an English author of short fiction, novels, comic books, graphic novels, audio theatre, and screenplays. His works include the comic book series ''[[The Sandman (comic book)|The Sandman]]'' and the novels ''[[Good Omens]]'', ''[[Stardust (Gaiman novel)|Stardust]]'', ''[[Anansi Boys]]'', ''[[American Gods]]'', ''[[Coraline]]'', and ''[[The Graveyard Book]]''. He co-created the TV series adaptations of ''[[Good Omens (TV series)|Good Omens]]'' and ''[[The Sandman (TV series)|The Sandman]]''.

Gaiman has won numerous awards, including the [[Hugo Award|Hugo]], [[Nebula Award|Nebula]], and [[Bram Stoker Award|Bram Stoker]] awards, as well as the [[Newbery Medal|Newbery]] and [[Carnegie Medal (literary award)|Carnegie]] medals. He is the first author to win both the Newbery and the Carnegie medals for the same work, ''The Graveyard Book'' (2008). In 2013, ''[[The Ocean at the End of the Lane]]'' was voted Book of the Year in the British [[Specsavers National Book Awards|National Book Awards]]. It was later adapted into a critically acclaimed stage play at the [[Royal National Theatre]] in London.

Beginning in 2024, several women accused Gaiman of sexual misconduct. This affected or halted production on several adaptations of his work.

