'''Josie Totah'''<ref name = Time>{{Cite magazine|url= https://time.com/5371387/josie-totah-transgender/|title=My Name Is Josie Totah – And I'm Ready to Be Free|magazine=Time|last = Totah|first = Josie|language=en|access-date=April 10, 2020}}</ref> (born August 5, 2001), formerly known as '''J. J. Totah''',<ref>{{Cite web|last=Kanhai|first=Landon Peoples, Devyn Galindo, Sarah Cobb, Brandy Allen, Tiffany Daugherty, Seeta|title=Josie Totah Didn't "Come Out" – She's Always Been Here|url=https://www.refinery29.com/en-us/josie-totah-transgender-coming-out-jj-totah-interview|access-date=March 14, 2021|website=refinery29.com|language=en}}</ref><ref>{{Cite web|author=Lisa Respers France|title='Champions' star Josie Totah comes out as transgender|url=https://www.cnn.com/2018/08/21/entertainment/josie-totah-transgender/index.html|access-date=March 14, 2021|publisher=CNN|date=August 21, 2018}}</ref> is an American actress. She is known for her recurring role on the [[Disney Channel]] series ''[[Jessie (2011 TV series)|Jessie]]'' and a supporting role on the 2013 [[American Broadcasting Company|ABC]] comedy series ''[[Back in the Game (2013 TV series)|Back in the Game]]''. She received praise from critics for her role in the 2016 film ''[[Other People (film)|Other People]]''. In 2018, she starred in the short-lived [[NBC]] comedy series ''[[Champions (U.S. TV series)|Champions]]''.
Totah starred as Lexi in [[Saved by the Bell (2020 TV series)|the 2020 revival of ''Saved by the Bell'']], which ran for two seasons.

Totah began her career playing male roles but publicly [[came out]] as a trans woman in August 2018, changing her first name to Josie.<ref>{{cite web |title=How Josie Totah Became Her True Self and an LGBTQ+ Icon |url=https://www.eonline.com/news/1334826/how-josie-totah-became-her-true-self-and-an-lgbtq-icon |publisher=E!|date=June 21, 2022 }}</ref>

