Totah was born in [[Sacramento, California]], the third child of Suheil and Christine Totah.<ref>{{cite web |title=Actress Josie Totah on finding her true identity in the Hollywood spotlight |url=https://www.today.com/style/former-disney-star-josie-totah-shares-identity-journey-t159971 |website=today.com|date=October 10, 2019 }}</ref> She has a sister and brother; she is of [[Palestinian]] and [[Lebanese people|Lebanese]] ancestry.<ref name="Davis-Ent">{{cite web|url=http://www.davisenterprise.com/local-news/j-j-totah-making-good-in-hollywood/|title=J.J. Totah: Making good in Hollywood|date=June 18, 2012|work=[[Davis Enterprise]]|access-date=April 13, 2018}}</ref>

