'''Robin Wayne Zander''' (born January 23, 1953)<ref>{{Cite web |last=Rose |first=Mike |title=Today’s famous birthdays list for January 23, 2023 includes celebrities Mariska Hargitay, Chita Rivera|url=https://www.cleveland.com/entertainment/2023/01/todays-famous-birthdays-list-for-january-23-2023-includes-celebrities-mariska-hargitay-chita-rivera.html |access-date=January 23, 2023 |website=[[Cleveland.com]]}}</ref> is an American musician, best known as the lead singer and rhythm guitarist for the rock band [[Cheap Trick]], but is also a solo artist. Zander was inducted into the [[Rock and Roll Hall of Fame]] in 2016 as a member of Cheap Trick.
[[File:Robin Zander - 2014.jpg|thumb|upright|Zander performing at Ruth Eckerd Hall, Clearwater, Florida – January 31, 2014]]

==Early life==
Zander was born in [[Beloit, Wisconsin]], and grew up in nearby [[Loves Park, Illinois]].<ref name="allmusic.com">{{cite web|url=https://www.allmusic.com/artist/robin-zander-mn0000831403/biography|title=Robin Zander - Biography & History|website=AllMusic}}</ref> He learned to play the guitar by age 12.<ref>{{cite web|url=https://www.dailyrecord.com/story/entertainment/music/2014/09/19/robin-zander-band-perform-newton/15781105/|title=Robin Zander Band to perform in Newton|website=Daily Record}}</ref> Zander graduated from Harlem High School in [[Machesney Park, Illinois]].<ref>{{cite web|url=https://www.journalstandard.com/article/20151218/NEWS/151219560|title=Rock and Roll Hall of Fame finally tells Cheap Trick it wants the Rockford band in its Class of 2016|first=Brian|last=Leaf|website=Journal Standard}}</ref> After playing in high school bands in the 1960s,<ref name="naplesnews.com">{{cite web|url=https://www.naplesnews.com/story/reader-submitted/entertainment/2016/05/02/cheap-tricks-lead-singer-robin-zanderset-to-rock-the-ranch/85932820/|title=Cheap Trick's lead singer Robin Zander set to rock The Ranch|website=Naples Daily News}}</ref> he joined Brian Beebe to form the folk duo Zander & Kent in the early 1970s.<ref>{{cite web|url=https://www.channel3000.com/madison-magazine/arts-and-culture/madison-area-musician-hopes-to-recover-in-time-for-show-with-cheap-trick-singer/790816889|title=Madison-area musician hopes to recover in time for show with Cheap Trick singer|first=Joel|last=Patenaude|date=September 22, 2018|website=WISC}}</ref>

